import { Col, Row } from "react-bootstrap";

export const Newsletter = () => {

  return (
      <Col lg={12}>
        <div className="newsletter-bx">
          <Row>
            <Col lg={12}>
              <h3 style={{fontFamily: 'Martian Mono monospace'}}>I'm committed to leveraging my skills and expertise to contribute to innovative projects and dynamic teams. Looking forward to hear from you!</h3>
            </Col>
          </Row>
        </div>
      </Col>
  )
}
